import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

interface Store {
  id: number;
  name: string;
  description: string;
  address: string;
  phone_number: string;
  store_url: string;
  store_img: string;
  tags: number[];
}

interface Tag {
  id: number;
  name: string;
  tag_type: number;
}

const PetShopStoreList: React.FC = () => {
  const { prefectureId } = useParams<{ prefectureId: string }>();
  const [stores, setStore] = useState<Store[]>([]);
  const [tags, setTags] = useState<Tag[]>([]);
  const [selectedPrefecture, setSelectedPrefecture] = useState<string>("");
  const [selectedTagIds, setSelectedTagIds] = useState<number[]>([]);
  const [type4, setType4Tag] = useState<Tag[]>([]);

  //店舗データの取得
  useEffect(() => {
    const fetchStores = async () => {
      try {
        const response = await fetch (
          `http://localhost:5003/stores/list/${prefectureId}`
        );
        const data = await response.json();
          setStore(data);
        } catch (error) {
          console.error("店舗情報の取得に失敗しました:", error);
          setStore([]);
        } 
      };
  fetchStores();
  }, [prefectureId]);

//タグの一覧
 useEffect(() => {
  const fetchTags = async () => {
    try {
      const response = await fetch (`http://localhost:5003/tags`);
      const data: Tag[] = await response.json();
      //タグを分類する
      const type4 = data.filter((tag) => tag.tag_type === 4 );

      setType4Tag(type4);
    } catch (error) {
      console.error("タグの取得に失敗しました:", error);
    }

  };
  fetchTags();
 }, []);

//店舗データの取得

   useEffect(() => {
    const fetchStores = async () => {
      try {
        let url;
        if (selectedTagIds.length === 0 ) {
          url = `http://localhost:5003/stores/list'/store-type/${prefectureId}/1`;
        } else {
          url = `http://localhost:5003/stores/list/tag/${prefectureId}?tagIds=${selectedTagIds.join(",")}`;
        }
        const response = await fetch(url);
        const data = await response.json();
        setStore(data);
      } catch (error) {
        console.error("店舗データの取得に失敗しました:", error);
      }
    };
    fetchStores();
   }, [prefectureId, selectedTagIds] );


  //都道府県名の設定
  useEffect(() => {
   const prefectureNames: { [key: string]: string } = {
    "1": "北海道",
    "60": "東京",
    "61": "神奈川",
    "70": "愛知",
    "73": "京都",
    "74": "大阪",
    "75": "兵庫",
   };

    setSelectedPrefecture(
      prefectureNames[prefectureId ?? ""] || "ペットショップ情報がありません"
    );
  },[prefectureId] );

  //タグデータの取得
  useEffect(() => {
    const fetchTags = async () => {
      try {
        const response = await fetch("http://localhost:5003/tags");
      if (!response.ok) {
        throw new Error(`HTTPエラー: ${response.status}`);
      }
      const data: Tag[] = await response.json();
      setTags(data);
      }catch(error) {
        console.error("タグの情報に失敗しました:", error);
      }
    };
  fetchTags();
  },[]);
  // タグ選択のハンドリング
  const handleTagClick = (tagId: number) => {
    setSelectedTagIds((prevSelectedTagIds) =>
      prevSelectedTagIds.includes(tagId)
        ? prevSelectedTagIds.filter((id) => id !== tagId) // タグを解除
        : [...prevSelectedTagIds, tagId] // タグを追加
    );
  };
  // フィルタリングされた店舗一覧
  const filteredStores =
    selectedTagIds.length > 0
      ? stores.filter((store) =>
          store.tags.some((tag) => selectedTagIds.includes(tag))
        )
      : stores;

  const isPrefectureSupported = selectedPrefecture !== "情報がありません";

  return (
    <div
      style={{
        textAlign: "center",
        padding: "20px",
        backgroundColor: "#FAF3E0",
      }}
    >
      {isPrefectureSupported ? (
        <>
          <h2>{selectedPrefecture}のドッグラン</h2>
          <p style={{ fontSize: "14px", marginBottom: "20px" }}>
            行きたいの条件を探す
          </p>
          {/* タグ選択エリア */}
          <div
            style={{
              display: "flex",
              flexWrap: "wrap",
              justifyContent: "center",
              gap: "10px",
            }}
          >
            {tags.map((tag) => (
              <button
                key={tag.id}
                onClick={() => handleTagClick(tag.id)}
                style={{
                  backgroundColor: selectedTagIds.includes(tag.id)
                    ? "#D1E8E2"
                    : "#FFF",
                  color: "#333",
                  padding: "10px 15px",
                  border: "1px solid #333",
                  borderRadius: "20px",
                  cursor: "pointer",
                  fontSize: "14px",
                }}
              >
                {tag.name}
              </button>
            ))}
          </div>

          {/* フィルタリング結果の表示 */}
          {selectedTagIds.length > 0 && filteredStores.length > 0 && (
            <div style={{ marginTop: "30px" }}>
              {filteredStores.map((store) => (
                <div key={store.id} style={{ marginBottom: "20px" }}>
                  <h3>{store.name}</h3>
                  <p>{store.description}</p>
                  <p>{store.address}</p>
                  <a
                    href={store.store_url}
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    URL
                  </a>
                  <br />
                  <img
                    src={store.store_img}
                    alt={store.name}
                    style={{ width: "200px", height: "auto" }}
                  />
                </div>
              ))}
            </div>
          )}
        </>
      ) : (
        <p>該当するペットショップが見つかりません。</p>
      )}
    </div>
  );
};

export default PetShopStoreList;
